import Axios from 'axios';

export const createDoctors = async (doctors) => {

  await doctors.forEach(async (doctor) => {
    let detailedDoctor
    try {
      let res = await Axios.get(
        `http://localhost:3000/geocodes/details/${doctor.place_id}`
      );
      detailedDoctor = res.data.result;
    } catch (err) {
      console.log("Error", err)
    }



    const {
      formatted_address,
      formatted_phone_number,
      name,
      place_id,
      rating,
      url,
      website,
      user_ratings_total,
      geometry: {
        location: { lat, lng },
      },
    } = detailedDoctor;

    const doctorHash = {
      place_id,
      name,
      formatted_address,
      rating,
      user_ratings_total,
      formatted_phone_number,
      lat,
      lng,
      url,
      website,
    };
    try {
      const myHeaders = new Headers();
      myHeaders.append('Content-Type', 'Application/json');
      myHeaders.append('accepts', 'application/json');
      const requestOptions = {
        method: 'POST',
        headers: myHeaders,
        body: JSON.stringify(doctorHash),
        redirect: 'follow',
      };
      let res = await fetch('http://localhost:3000/doctors', requestOptions)
      let data = await res.json()
      console.log(data)
    } catch (err) {
     console.log(err) 
    }
  });
};
